const About = () => {
    return (
        <div className="About">
            <h1>About Web Pigeon...</h1>
            <p>
                Web Pigeon is a free anonmyous web messaging app accessible to anyone.  All of the messengers are public to anyone, the idea is that they will regulate themselves.  
                None of the messages are encrypted, encryption prevents man in the middle attacks, it is up to the user to secure their endpoints for true anonymity.
            </p>
            
            <p>
                Right now Web Pigeon is a proof of concept, it is fully functional and could scale...
            </p>
        </div>
    );
}
 
export default About;
